import React, { useEffect, useState } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  useMediaQuery,
  useTheme,
} from "@mui/material";
import { Link } from "react-router-dom";
import { useAuth } from "../../components/context/AuthContextProvider";
import { ADMIN_EMAIL } from "../../helpers/const";
import MenuIcon from "@mui/icons-material/Menu";
import CloseIcon from "@mui/icons-material/Close";
import "./Navbar.css";

const Navbar = () => {
  const { user, logoutUser } = useAuth();
  const ADMIN_EMAIL = "admin@example.com";
  const [isAdmin, setIsAdmin] = useState(false);
  const [isDrawerOpen, setDrawerOpen] = useState(false);
  const [isMobile, setIsMobile] = useState(window.innerWidth < 600);

  useEffect(() => {
    setIsAdmin(user?.email === ADMIN_EMAIL);
  }, [user]);

  useEffect(() => {
    const handleResize = () => setIsMobile(window.innerWidth < 600);
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  const toggleDrawer = (open) => () => {
    setDrawerOpen(open);
  };

  return (
    <>
      <AppBar position="fixed" style={{ flexGrow: 1, width: "100%" }}>
        <Toolbar>
          {isMobile && (
            <IconButton
              edge="start"
              color="inherit"
              onClick={toggleDrawer(true)}
            >
              <MenuIcon />
            </IconButton>
          )}
          <div style={{ flexGrow: 1 }}>
            <Link to="/">Главная</Link>
          </div>
          {isAdmin && <Link to="/admin">Админ</Link>}
          {user ? (
            <button onClick={logoutUser}>Выйти</button>
          ) : (
            <Link to="/login">Войти</Link>
          )}
        </Toolbar>
      </AppBar>
      <Drawer anchor="left" open={isDrawerOpen} onClose={toggleDrawer(false)}>
        <List>
          <ListItem
            button
            component={Link}
            to="/"
            onClick={toggleDrawer(false)}
          >
            <ListItemText primary="Главная" />
          </ListItem>
          {isAdmin && (
            <ListItem
              button
              component={Link}
              to="/admin"
              onClick={toggleDrawer(false)}
            >
              <ListItemText primary="Админ" />
            </ListItem>
          )}
        </List>
      </Drawer>
    </>
  );
};

// Стили для компонента
const styles = {
  root: {
    flexGrow: 1,
    width: "100%",
    height: "auto",
    overflow: "hidden",
  },
  appBar: {
    backgroundColor: "#1a1a1a",
    color: "#ffffff",
    overflow: "hidden",
    width: "auto",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.2)", // Тень для AppBar
  },
  toolbar: {
    display: "flex",
    justifyContent: "space-between",
    width: "auto",
    overflow: "hidden",
  },
  leftItems: {
    display: "flex",
    alignItems: "center",
    width: "auto",
    height: "40px",
  },
  centerItems: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    width: "auto",
    height: "40px",
  },
  rightItems: {
    display: "flex",
    alignItems: "center",
    width: "auto",
    height: "40px",
  },
  menuButton: {
    marginRight: 10,
    overflow: "hidden",
  },
  menuItem: {
    color: "#ffffff",
    transition: "color 0.3s",
    fontSize: "1rem", // Немного больший шрифт для лучшей видимости
    fontWeight: "bold", // Одинаковая толщина текста для согласованности
  },
  icon: {
    width: "auto",
    height: 40,
    marginRight: 10,
  },
  drawerList: {
    width: 250,
    // height: "35%",
    transition: "background-color 0.3s ease",
    // backgroundColor: "rgba(0, 0, 0, 0.1)", // Прозрачный фон
  },
  drawerHeader: {
    display: "flex",
    justifyContent: "flex-end",
    padding: "10px",
    height: "40px",
  },
  closeButton: {
    color: "#000",
    // transition: "color 0.3s",
  },
  drawer: {
    backgroundColor: "rgba(0, 0, 0, 0.9)", // Темный фон для современного вида
    transition: "background-color 0.3s ease",
    paddingTop: "10px", // Добавляем отступ сверху для лучшего выравнивания
  },
};

export default Navbar;
